create table raffle_records
(
    id                int unsigned auto_increment
        primary key,
    activity_id       int unsigned                           not null comment '活动id',
    team_success_time varchar(255)                           not null comment '组团成功时间',
    part_people_num   int unsigned                           not null comment '参与人数',
    status            int unsigned default 0                 not null comment '组团状态,0:等待,1:成功,2:超时',
    created_at        datetime     default CURRENT_TIMESTAMP not null,
    updated_at        datetime                               null
)
    collate = utf8mb4_unicode_ci;

